create table air_airlines (
  airline_id numeric(5) not null,
  iata char(2) not null,
  airline_name varchar(30),
  base_airport_id numeric(5) not null
);

commit;

create table air_airplane_types (
  airplane_type_id numeric(3) not null,
  name varchar(50) not null
);


create table air_airplanes (
  airplane_id numeric(5) not null,
  airline_id integer not null,
  airplane_type_id numeric(3) not null,
  capacity numeric(3) not null
);


create table air_airports (
  airport_id numeric(5) not null,
  iata char(3),
  icao char(4) not null,
  name varchar(50) not null
);


create table air_airports_geo (
  airport_id numeric(5) not null,
  name varchar(50) not null,
  city varchar(50),
  country varchar(50),
  latitude decimal(11,8) not null,
  longitude decimal(11,8) not null
);


commit;